import React from 'react';
import styled from 'styled-components';
import LoginForm from '../components/LoginForm'

const Register = ({}) => {
    return (
        <Wrapper>
            <H1>Se connecter à Scoolize <span>Predict</span></H1>
            <LoginForm></LoginForm>
            <P href='/register'>Créer un compte</P>
        </Wrapper>
    );
};

export default Register;


const Wrapper=styled.section`
    display:flex;
    width:100%;
    align-items:center;
    flex-direction:column;
    padding-top:100px;
    padding-bottom:100px;
`

const H1=styled.h1`
    font-size:3rem;
    color:#E54B4B;
    span{
        color:#358F8B;
    }
    padding-bottom:80px;
`

const P=styled.a`
    font-size:0.8rem;
`
